INSERT INTO `wp8c_posts` VALUES (1,1,'2018-03-20 23:44:12','2018-03-20 23:44:12','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','trash','open','open','','hello-world__trashed','','','2018-03-30 00:59:05','2018-03-30 00:59:05','',0,'https://socialcyclinglex.org/?p=1',0,'post','',1),(2,1,'2018-03-20 23:44:12','2018-03-20 23:44:12','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"https://socialcyclinglex.org/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','closed','open','','sample-page__trashed','','','2018-03-21 01:04:57','2018-03-21 01:04:57','',0,'https://socialcyclinglex.org/?page_id=2',0,'page','',0),(71,1,'2018-03-21 13:28:41','2018-03-21 13:28:41','https://socialcyclinglex.org/wp-content/uploads/2018/03/cropped-SCLlogowhite.png','cropped-SCLlogowhite.png','','inherit','open','closed','','cropped-scllogowhite-png','','','2018-03-21 13:28:41','2018-03-21 13:28:41','',0,'https://socialcyclinglex.org/wp-content/uploads/2018/03/cropped-SCLlogowhite.png',0,'attachment','image/png',0),(24,1,'2018-03-21 01:04:57','2018-03-21 01:04:57','This is an e